import React from 'react';

const Navbar = () => {
  return (
    <nav className="navbar navbar-expand-lg navbar-dark bd-dark py-2">
      <Link to="/" className="navbar-brand ml-5">
        React-CRUD
      </Link>
      <ul className="navbar-nav"></ul>
    </nav>
  );
};

export default Navbar;
